INSERT INTO `restaurant_list` (`rest_id`, `rest_name`, `rest_area`, `rest_adress`, `rest_lon`, `rest_lat`, `rest_intro`, `rest_class`, `created_time`) VALUES
(1, 'Gino Pizza店', '新北市', '蘆洲區長安街108巷27號', 121.4621, 25.0825, '蘆洲湯姆咖啡廚房提供平價、專業歐式料理、義大利麵、排餐，還有專業窯烤披薩，講求高品質、健康的料理方式，份量大、走精緻的視覺效果，您可在充滿南法情懷的餐廳用餐。', '晚餐', '2023-05-18 15:47:26'),
(2, '香榭咖啡屋', '新北市', '板橋區大勇街28號', 121.45381, 25.01706, '美麗香榭‧遇見幸福-在光影變幻錯落間，用一杯咖啡的溫柔，吟一首知解的歌，燃一枚笑顏，暖無數個寒天。也許情歌慢板輕跳，也許琴聲響動，也許埋首工作，也許自在閱讀，在香榭，歡聚與獨處都是幸福 ', '早午餐', '2023-05-18 08:44:41'),
(3, '彰鶯肉圓', '新北市', '鶯歌區行政路35號', 121.35205, 24.95598, '正統彰化風味的肉圓，原來在鶯歌也吃得到，紮實飽滿的內餡讓人一吃就上癮，再咬一口超Q彈的肉圓皮，吃了一碗也能有飽足感！好的肉圓搭配的醬汁很重要，在鶯歌吃到的肉圓醬汁是店家自行調製，加一小匙蒜泥會讓肉圓更有滋味！一碗肉圓，搭配四神湯一起品嚐，是在鶯歌就能大飽口福的庶民美食小吃！', '下午茶', '2023-05-18 08:45:00'),
(4, '長角96', '新北市', '三芝區新庄子96號', 121.45381, 25.27485, '肉質鮮美厚實的牛排，配上特製的墨西哥辣豆，再來一杯長角生啤酒，難忘的滋味讓人回味無窮。另還有適合小朋友的兒童餐，店內的酒吧區開放至夜間11點，有多種啤酒及調酒可供選擇。店家在假日邀請樂團到場表演，讓饕客的聽覺和味覺同時得到莫大的滿足。寬廣的停車空間及兒童遊樂設施，十分貼心。', '晚餐', '2023-05-18 08:48:58'),
(5, '福華海鮮餐廳', '新北市', '金山區民生路51巷1號之2', 121.4621, 25.2202, '湯姆咖啡嚴選食材及優質調味品，以現點現做的方式，提供道地義大利風味料理，以及融合歐法日料理元素的創新菜色，從開胃菜、義大利式窯烤PIZZA、義大利麵、精緻套餐到甜點、義式咖啡、花茶應有盡有。義大利式窯烤PIZZA，擁有外厚內薄，麵皮口感香Q彈牙的特色，越嚼越香，且外型非常特別，外圈的點點烤痕，讓他有豹紋披薩的暱稱，邀您一嚐這獨到的異國美食', '下午茶', '2023-05-18 16:04:44'),
(6, '狸小路燒肉專賣店', '基隆市', '仁愛區愛五路34號2樓', 121.74606, 25.12889, '本店之調醬由札榥名師傳承，再經由台灣名廚以最適合本地的口味來調製。本店秉持三大堅持：「好吃是應該的」、「衛生是應該的」、「價格合理是應該的」。狸小路不只要您品嚐美食，更期盼在您用餐的過程中一起感受到我們真誠的服務', '下午茶', '2023-05-18 08:51:02'),
(7, '樂品喜塘咖啡廳', '基隆市', '中正區平一路360號', 121.76385, 25.16063, '樂品喜塘，2018年落腳和平島公園遊客中心3樓，從第一杯飲料開始，始終不曾脫離「打造在地品牌」的營運核心價值，店內提供的不只是天生自帶的海景，也提供專業職人的咖啡品味，從世界咖啡大師賽冠軍咖啡豆所變化出的經典花式咖啡，到自家烘焙的精品咖啡，還有融入基隆潮間帶意象的獨家糕點-石蓴生乳酪蛋糕、石蓴黑糖海鹽脆餅', '下午茶', '2023-05-18 15:48:10'),
