(19, 'Gino Pizza店', '', '蘆洲區長安街108巷27號', 121.4621, 25.08255, '蘆洲湯姆咖啡廚房提供平價、專業歐式料理、義大利麵、排餐，還有專業窯烤披薩，講求高品質、健康的料理方式，份量大、走精緻的視覺效果，您可在充滿南法情懷的餐廳用餐。湯姆咖啡嚴選食材及優質調味品，以現點現做的方式，提供道地義大利風味料理，以及融合歐法日料理元素的創新菜色，從開胃菜、義大利式窯烤PIZZA、義大利麵、精緻套餐到甜點、義式咖啡、花茶應有盡有。義大利式窯烤PIZZA，擁有外厚內薄，麵皮口感香Q彈牙的特色，越嚼越香，且外型非常特別，外圈的點點烤痕，讓他有豹紋披薩的暱稱，邀您一嚐這獨到的異國美食', '', '2023-05-11 02:58:20'),
